import React from 'react';
import TeamCard from './TeamCard';



const teams = [
  { id: 1, school: 'Duke', mascot: 'Blue Devils', city: 'Durham', state: 'NC' },
  { id: 2, school: 'North Carolina', mascot: 'Tar Heels', city: 'Chapel Hill', state: 'NC' },
  { id: 3, school: 'Kentucky', mascot: 'Wildcats', city: 'Lexington', state: 'KY' },
  { id: 4, school: 'Kansas', mascot: 'Jayhawks', city: 'Lawrence', state: 'KS' },
  { id: 5, school: 'UCLA', mascot: 'Bruins', city: 'Los Angeles', state: 'CA' },
];

function TeamList() {
  return (
    <div className="team-list">
      {teams.map((team) => (
        <TeamCard
          key={team.id}
          school={team.school}
          mascot={team.mascot}
          city={team.city}
          state={team.state}
        />
      ))}
    </div>
  );
}

export default TeamList;
